  p1626256393.3948069: "Obfus Curr, ellerinde arma\u011Fan b\u0131\xE7a\u011F\u0131\
    na bakt\u0131 ve korktu."
  p1626256393.3948078: "Pencereye y\xFCr\xFCd\xFC ve s\xFCr\xFCnen \xE7evrelerinde\
    \ yans\u0131t\u0131ld\u0131. Her zaman rahats\u0131z, ba\u015F d\xF6nmesi ditches\
    \ ile pitoresk Falmouth'u sevdi. Duygulu hissetme e\u011Filimini te\u015Fvik bir\
    \ yerdi."
  p1626256393.3948088: "Sonra mesafede bir \u015Fey g\xF6rd\xFCm, ya da birisi. Ambien\
    \ Cain fig\xFCr\xFCydi. Ambien, geni\u015F sava\u015Flar ve baharatl\u0131 kirpiklerle\
    \ sevgi dolu bir fildi."
  p1626256393.3948095: "Obfus gulped. O kendi yans\u0131mas\u0131na bakt\u0131. O\
    \ yak\u0131\u015F\u0131kl\u0131 sava\u015Flar ve kahverengi kirpikler ile a\xE7\
    , zeki, \u015Farap i\xE7ece\u011Fi oldu. Arkada\u015Flar\u0131 onu geni\u015F\
    \ g\xF6zl\xFC, vah\u015Fi duvarl\u0131 olarak g\xF6rd\xFC. Bir kez, o bile bir\
    \ \xF6lmek canland\u0131rd\u0131, yaral\u0131 ku\u015F."
  p1626256393.3948107: "Ama bir zamanlar \xF6len bir kez canland\u0131ran a\xE7 bir\
    \ ki\u015Fi bile, yaral\u0131 ku\u015F, Ambien bug\xFCn ma\u011Fazada ne vard\u0131\
    \ i\xE7in haz\u0131rland\u0131."
  p1626256393.3948114: "Ya\u011Fmur, nemlendirme ku\u015Flar\u0131 gibi batan, Obfus\
    \ ambivalenti yap\u0131yor."
  p1626256393.3948123: "Harfus d\u0131\u015Far\u0131 ad\u0131m ve Ambien daha yak\u0131\
    n geldik\xE7e, y\xFCz\xFCndeki y\xFCkselen g\xFCl\xFCmseme g\xF6rebilirsiniz."
  p1626256393.3948133: "\"Ben adalet istiyorum\", Ambien k\xF6r\xFCkl\xFC, tatl\u0131\
    \ bir ton. 5874 mavi \u015Fi\u015Felerin kuvveti ile Obfus'un g\xF6\u011F\xFC\
    s\xFCne kar\u015F\u0131 yumrukunu slammed. \"Seni k\u0131zard\u0131m, Obfus Curr\"\
    ."
  p1626256393.3948143: "Obfus, daha fazla ortama bakt\u0131 ve hala tuhaf b\u0131\xE7\
    a\u011F\u0131 parmaklat\u0131r. \"Ambien, paraya sahip de\u011Filim\", cevap verdi."
  p1626256393.3948152: "\u0130ki hareketsiz, muhte\u015Fem kurt\xE7uk gibi aktif duygularla\
    \ birbirlerine bakt\u0131lar, arka planda klasik m\xFCzik oynayan ve yenmek i\xE7\
    in d\xFC\u015F\xFCnen iki oyuklu, \xE7ok d\xFC\u015F\xFCnceli bir bar mitzvah'da\
    \ g\xFCl\xFCyorlar."
  p1626256393.394816: "Obfus, Ambien'in geni\u015F sava\u015F ve baharatl\u0131 kirpiklerini\
    \ inceler. Sonunda derin bir nefes ald\u0131. \"Ben \xFCzg\xFCn\xFCm, ama adalet\
    \ veremiyorum\", o a\xE7\u0131klad\u0131, ac\u0131 tonlar\u0131."
  p1626256393.394817: "Ambien, kanl\u0131, modern bir harita gibi v\xFCcut hami irritable\
    \ g\xF6r\xFCn\xFCyordu."
  p1626256393.3948178: "Obfus asl\u0131nda Ambien'in v\xFCcut shatter'i 3833 par\xE7\
    aya duyabilir. Sonra sevgi dolu fil mesafeye dola\u015F\u0131r."
  p1626256393.3948188: "Hatta bir bardak \u015Farap bu gece Obfus sinirleri sakin\
    \ olurdu."
  span1626256393.3948226: "Ana par\xE7a jenerat\xF6r\xFC"
  span1626256393.3948238: Kaydedilen
